import React, {useEffect, useState } from 'react';
import './App.css';

const App = () => {

  const APP_ID = "75ae9eb5";
  const APP_KEY = "be049df214c6d127695e88d71abe701d";

  //const example = `https://api.edamam.com/search?q=chicken&app_id=${APP_ID}&app_key=${APP_KEY}`

  useEffect( async() => {

  }, [])

  const getReceipes = async () => {
    const responce = await fetch (`https://api.edamam.com/search?q=chicken&app_id=${APP_ID}&app_key=${APP_KEY}`)
    const data = responce.json();
    console.log(data)
  }

  const [recipes,setrecipes]= useState(0);


  return (
    <div className="App">
      <form className="search-form">
        <input className="search-bar" type="text"/>
        <button className="search-button" typeof="submit">Search</button>
      </form>
      <button className="search-button" typeof="submit" onClick={()=>setrecipes(recipes+1)}>{recipes}</button>
    </div>
)

}

export default App;
